    true,nt"url": null,nt"notes": "&lt;p&gt;Develop integrated computational/experimental/processing
    methodologies for accerlating discovery and insertion of mateirals to satisfy NASA&amp;#39;s
    unique mission demands&lt;/p&gt;&lt;ul&gt;&lt;li&gt;The challenges:&lt;ol&gt;&lt;li&gt;Validated
    design tools that incorporate materials properties, processes and design requirements&lt;/li&gt;&lt;li&gt;Materials
    process control to rapidly mature emerging manufacturing methods to industry ready&lt;/li&gt;&lt;/ol&gt;&lt;/li&gt;&lt;li&gt;Approach:&lt;ol&gt;&lt;li&gt;Physics-based
    modeling to guide material design e.g. matrix composition, crosslinking between
    CNTs, grain size and texture&lt;/li&gt;&lt;li&gt;Multiscale modeling influence of
    materials design on mechanical properties and durability&lt;/li&gt;&lt;li&gt;Process
    modeling to determine processing parameters required to produce as-designed material
    nano-/micro-structures and enable advanced manufacturing methods utilization&lt;/li&gt;&lt;li&gt;Utilize
